function LightenDarkenColor(col,amt) {
    var usePound = false;
    if ( col[0] == "#" ) {
        col = col.slice(1);
        usePound = true;
    }

    var num = parseInt(col,16);

    var r = (num >> 16) + amt;

    if ( r > 255 ) r = 255;
    else if  (r < 0) r = 0;

    var b = ((num >> 8) & 0x00FF) + amt;

    if ( b > 255 ) b = 255;
    else if  (b < 0) b = 0;

    var g = (num & 0x0000FF) + amt;

    if ( g > 255 ) g = 255;
    else if  ( g < 0 ) g = 0;

    return (usePound?"#":"") + (g | (b << 8) | (r << 16)).toString(16);
}

function MapView() {
	this.closeMoveMenu();
	this.highlighted = null;
	// disable mouse events for some territories
	for(var i = 0; i < NotInteractable.length; i++) {
		NotInteractable[i].node.setAttribute('pointer-events', 'none');
	}
	
	for(var i = 0; i < Invalid.length; i++) {
		Invalid[i].attr({'cursor':'not-allowed'});
	}

	Object.keys(Interactable).forEach((id) => {
		var territory = Interactable[id];
		territory.forEach((region) => {
			// register pointer cursor
			region.attr({'cursor':'pointer'});
		
			// register click event
			var self = this;
			region.click(function(e) {
				self.mouseX = e.clientX;
				self.mouseY = e.clientY;
				self.territoryClickHandler(this.data('id'));
			});
	
			// register hover effect
			region.mouseover(function(e) {
				territory.forEach((region2) => {
					region2.node.style.fill = LightenDarkenColor(region2.attr('fill'), -40);
				});
			});

			region.mouseout(function(e) {
				territory.forEach((region2) => {
					region2.node.style.fill = region2.attr('fill');
				});
			});
		});
	});
}

MapView.prototype.update = function(territories, units, dislodgedUnits) {
	colourTerritories(territories);
	drawUnits(units, dislodgedUnits);
}

function colourTerritories(territoryOwnership) {
	Object.keys(territoryOwnership).forEach((territory) => {
		if(!(territory in Colourable)) {
			return;
		}
		var nation = territoryOwnership[territory].nation;
		var terrColour;
		var starColour;
		switch(nation) {
			case Nation.AUSTRIA:
				terrColour = '#ef6448';
				starColour = '#d72f26';
				break;
			case Nation.ENGLAND:
				terrColour = '#6c73d6';
				starColour = '#4650c8';
				break;
			case Nation.FRANCE:
				terrColour = '#4eb4d3';
				starColour = '#2072b5';
				break;
			case Nation.GERMANY:
				terrColour = '#666666';
				starColour = '#4c4d4d';
				break;
			case Nation.ITALY:
				terrColour = '#7fc97f';
				starColour = '#30a353';
				break;
			case Nation.RUSSIA:
				terrColour = '#f9f9f9';
				starColour = '#dadcdd';
				break;
			case Nation.TURKEY:
				terrColour = '#ffd92f';
				starColour = '#dccb00';
				break;
			default: // neutral
				terrColour = '#e5c494';
				starColour = '#d99057';
		}
		Colourable[territory].forEach((elem) => {
			if(elem.data('id') === 'Star') {
				elem.attr('fill', starColour);
				elem.node.style.fill = starColour;
			} else {
				elem.attr('fill', terrColour);
				elem.node.style.fill = terrColour;
			}
		});
	});
}

function drawUnits(units, dislodgedUnits) {
	for(var i = 0; i < Units.length; i++) {
		Units[i].hide();
	}
	Object.keys(units).forEach((key) => {
		for(var i = 0; i < Units.length; i++) {
			var type = units[key].type;
			if(Units[i].data('id') == key) {
				if((key === 'StPetersburg' || key === 'Spain' || key === 'Bulgaria')
					&& type === 'fleet' 
					&& Units[i].data('coast') !== units[key].coast) {
					continue;
				}
				if(Units[i].data('type') == type) {
					var colour;
					switch(units[key].nation) {
						case Nation.AUSTRIA:
							colour = '#d72f26';
							break;
						case Nation.ENGLAND:
							colour = '#4650c8';
							break;
						case Nation.FRANCE:
							colour = '#2072b5';
							break;
						case Nation.GERMANY:
							colour = '#4c4d4d';
							break;
						case Nation.ITALY:
							colour = '#30a353';
							break;
						case Nation.RUSSIA:
							colour = '#dadcdd';
							break;
						case Nation.TURKEY:
							colour = '#dccb00';
							break;
						default:
							colour = '#d99057';
							console.log('ERROR: nation name not correct');
					} 
					Units[i].attr('fill', colour);
				} else if(Units[i].data('type') != 'lace' || type != 'army') {
					continue;
				} else {
					console.log('lace');
				}
				Units[i].show();
			}
		}
	});
}

